// HasEvent applies the HasEdge predicate on the "event" edge.
func HasEvent() predicate.EventOccurrence {
	return predicate.EventOccurrence(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, EventTable, EventColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasEventWith applies the HasEdge predicate on the "event" edge with a given conditions (other predicates).
func HasEventWith(preds ...predicate.Event) predicate.EventOccurrence {
	return predicate.EventOccurrence(func(s *sql.Selector) {
		step := newEventStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.EventOccurrence) predicate.EventOccurrence {
	return predicate.EventOccurrence(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.EventOccurrence) predicate.EventOccurrence {
	return predicate.EventOccurrence(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.EventOccurrence) predicate.EventOccurrence {
	return predicate.EventOccurrence(sql.NotPredicates(p))
}
